import React, { useState } from 'react';
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  SafeAreaView,
  ScrollView,
  StatusBar,
  CheckBox,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { globalStyles } from '../styles/globalStyles';

interface LeaveScreenProps {
  onBack: () => void;
  onApplyLeave: () => void;
}

const LeaveScreen: React.FC<LeaveScreenProps> = ({ onBack, onApplyLeave }) => {
  const [formData, setFormData] = useState({
    halfDay: false,
    leaveType: '',
    fromDate: '',
    toDate: '',
    email: '',
    reason: '',
  });

  const handleInputChange = (field: string, value: string | boolean): void => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleApplyLeave = (): void => {
    console.log('Applying leave:', formData);
    onApplyLeave();
  };

  return (
    <SafeAreaView style={globalStyles.complaintContainer}>
      <StatusBar barStyle="light-content" backgroundColor="#3498db" />
      
      {/* Header */}
      <View style={globalStyles.complaintHeader}>
        <TouchableOpacity onPress={onBack} style={globalStyles.complaintBackButton}>
          <Ionicons name="arrow-back" size={24} color="#fff" />
        </TouchableOpacity>
        
        <Text style={globalStyles.leaveTitle}>Apply Leave</Text>
        
        <TouchableOpacity onPress={handleApplyLeave} style={globalStyles.complaintSaveButton}>
          <Ionicons name="checkmark" size={20} color="#fff" />
          <Text style={globalStyles.complaintSaveText}>Apply</Text>
        </TouchableOpacity>
      </View>

      {/* Form Content */}
      <ScrollView style={globalStyles.complaintContent} showsVerticalScrollIndicator={false}>
        {/* Leave Type Field */}
        <View style={globalStyles.complaintFieldContainer}>
          <Text style={globalStyles.complaintFieldLabel}>Leave Type:</Text>
          <View style={globalStyles.complaintDropdownContainer}>
            <TextInput
              style={globalStyles.complaintDropdownInput}
              placeholder="Select Leave Type"
              value={formData.leaveType}
              onChangeText={(value) => handleInputChange('leaveType', value)}
            />
            <Ionicons name="chevron-down" size={20} color="#666" />
          </View>
        </View>

        {/* Start Date Field */}
        <View style={globalStyles.complaintFieldContainer}>
          <Text style={globalStyles.complaintFieldLabel}>Start Date:</Text>
          <TextInput
            style={globalStyles.complaintTextInput}
            placeholder="Select Start Date"
            value={formData.startDate}
            onChangeText={(value) => handleInputChange('startDate', value)}
          />
        </View>

        {/* End Date Field */}
        <View style={globalStyles.complaintFieldContainer}>
          <Text style={globalStyles.complaintFieldLabel}>End Date:</Text>
          <TextInput
            style={globalStyles.complaintTextInput}
            placeholder="Select End Date"
            value={formData.endDate}
            onChangeText={(value) => handleInputChange('endDate', value)}
          />
        </View>

        {/* Total Days Field */}
        <View style={globalStyles.complaintFieldContainer}>
          <Text style={globalStyles.complaintFieldLabel}>Total Days:</Text>
          <TextInput
            style={globalStyles.complaintTextInput}
            placeholder="Enter Total Days"
            value={formData.totalDays}
            onChangeText={(value) => handleInputChange('totalDays', value)}
            keyboardType="numeric"
          />
        </View>

        {/* Emergency Contact Field */}
        <View style={globalStyles.complaintFieldContainer}>
          <Text style={globalStyles.complaintFieldLabel}>Emergency Contact:</Text>
          <TextInput
            style={globalStyles.complaintTextInput}
            placeholder="Enter Emergency Contact"
            value={formData.emergencyContact}
            onChangeText={(value) => handleInputChange('emergencyContact', value)}
            keyboardType="phone-pad"
          />
        </View>

        {/* Reason Field */}
        <View style={globalStyles.complaintFieldContainer}>
          <Text style={globalStyles.complaintFieldLabel}>Reason</Text>
          <TextInput
            style={globalStyles.complaintMessageInput}
            placeholder="Enter reason for leave..."
            value={formData.reason}
            onChangeText={(value) => handleInputChange('reason', value)}
            multiline
            numberOfLines={4}
            textAlignVertical="top"
          />
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

export default LeaveScreen;
